description:
Hur skulle du reagera, om du tre ar efter din fars dod. Fick ett brev,
underskrivit av honom dar du inbjods till att besoka ett overgivet 
hus mitt i ingenstans i Kina. Nyfiken av naturen beslutar du dig for
att ska dit. Val dar, upptacker du att det finns andra besokare ocksa...
